class UnblindedTx {
  UnblindedTx(
      {error,
        required this.hex
      });

  String error = "";
  String hex = "";

  get stringInfo {
    String dateSlug =
        "Transaction hex\n"
            "HEX: " + hex;
    return dateSlug;
  }

  factory UnblindedTx.fromJson(Map<String, dynamic> json) => UnblindedTx(
    hex: json['hex'] == null ? null : json["hex"],
  );

  Map<String, dynamic> toJson() => {"hex": hex};
